define SCR1 $00 ; screen position 1
define SCR2 $01 ; screen position 2
define SETB $13 ; bit setting
define RUNL $14 ; run length
define DTA1 $02 ; data pointer 1
define DTA2 $03 ; data pointer 2
define DTA3 $04 ; data bit pointer
define CONST_BIT $09; bit bool table - goes to $10
define CONST_BIT_P1 $11
define CONST_BIT_P2 $12
	lda #$07 ; DAT PAGE
	sta DTA2
	lda #$00; DAT LOC
	sta DTA1
	lda #$09
	sta CONST_BIT_P1
	lda #$02
	sta SCR2
; generate CONST_BIT table
	lda #$80
	ldy #$00
build_table:
	sta (CONST_BIT_P1),y
	iny
	lsr
	bne build_table
	
main:
	jsr next_bit
	sta SETB
	jsr next_runLen
	;setting and len set
	;start render

draw_run:
	ldx #$00
	lda SETB
	sta (SCR1,x)
	jsr inc_scr
	dec RUNL
	lda #$00
	cmp RUNL
	bne draw_run
	jmp main
	brk
;--------------- RENDER ------------------------
inc_scr:
	lda #$20
	adc SCR1
	sta SCR1
	lda #$00
	adc SCR2
	sta SCR2
	cmp #$06
	bne inc_out
	;new col
	lda #$02
	sta SCR2
	inc SCR1
	lda #$20
	cmp SCR1
	bne inc_out
	;new frame
	lda #$00
	sta SCR1

	ldx #$00
	lda #$00
delay:
	inx
	bne delay
	adc #$01
	cmp #$B6
	bne delay

inc_out:
	rts

;--------------- PARSE --------------------
inc_point:
	inc DTA1
	bne inc_point2
	inc DTA2
inc_point2: 
	rts
	
next_bit: ;writes next bit to A - A X Y
	;get current byte
	ldy #$00
	lda (DTA1),y
	ldy DTA3
	and (CONST_BIT_P1),y
	;convert to b1
	beq bit_zero
	lda #$01
bit_zero:
	tax
	;increment DTA3
	inc DTA3
	lda #$08
	cmp DTA3
	bne keep_bit
	lda #$00
	sta DTA3
	jsr inc_point
keep_bit:
	txa
	rts
	
next_runLen: ;write runlen to RUNL - A
	jsr next_bit
	sta RUNL
	jsr next_bit
	asl RUNL
	adc RUNL
	sta RUNL
	jsr next_bit
	asl RUNL
	adc RUNL
	sta RUNL
	jsr next_bit
	asl RUNL
	adc RUNL
	sta RUNL
	jsr next_bit
	asl RUNL
	adc RUNL
	sta RUNL
	jsr next_bit
	asl RUNL
	adc RUNL
	sta RUNL
	rts
